import './App.css';
import { ChakraProvider } from '@chakra-ui/react'
import { useGetEntitiesQuery } from "./services/playmaker";
import { Tabs, TabList, TabPanels, Tab, TabPanel } from '@chakra-ui/react';

 function App() {
  const {data: t} = useGetEntitiesQuery({name: 'tournaments', populate: true});
  console.log(t)
  return (
    <ChakraProvider>
      <div className="App"> 
      <Tabs>
  <TabList>
    <Tab>One</Tab>
    <Tab>Two</Tab>
    <Tab>Three</Tab>
  </TabList>

  <TabPanels>
    <TabPanel>
      <p>one!</p>
    </TabPanel>
    <TabPanel>
      <p>two!</p>
    </TabPanel>
    <TabPanel>
      <p>three!</p>
    </TabPanel>
  </TabPanels>
</Tabs> 
          {t && t.data.map(t => <h1>{t.attributes.name}</h1>)}
      </div>
    </ChakraProvider>
  );
}

export default App;
